package homeWork5;/** * ????? ?????? Student. * @autor ????? ?????? * @version 1.1 */public class Student implements Comparable <Student> {    private int number;    private String name;    private int age;    private double rate;    private boolean olympic;    public void setNumber(int number) {        this.number = number;    }    public void setName(String name) {        this.name = name;    }    public void setAge(int age) {        this.age = age;    }    public void setRate(double rate) {        this.rate = rate;    }    public void setOlympic(boolean olympic) {        this.olympic = olympic;    }    @Override    public int compareTo(Student o) {        return  this.name.compareTo(o.name);    }    @Override    public String toString() {        StringBuilder builder = new StringBuilder();        builder.append("number = " + number                + " name = " + name + " age =  " + age                + " rate = " + rate + " olympic = " + olympic);        return builder.toString();    }    public int getNumber() {        return number;    }    public String getName() {        return name;    }    public int getAge() {        return age;    }    public double getRate() {        return rate;    }    public boolean isOlympic() {        return olympic;    }}